import React from "react";

const Login = () => {
  return (
    <>
      <section id="login-section" style={{backgroundImage:`url()`}}>
        <div className="container">
          <div className="row">
            <div className="contact-us">
              <h1 className="text-center text-black text-3xl">contact us</h1>
              <div className="form-conatiner">
                <div className="form-image">
                  <img src='../image/login1.jpg' alt="" />
                </div>
                <form action="/">
                  <h1>Get in Touch</h1>
                  <div className="contact-form"  id="Name">
                    <i class="fa-solid fa-user  fa-sm"></i>
                    <input type="text" placeholder="Name" />
                  </div>
                  <div className="contact-form" id="Email">
                    <i class="fa-solid fa-envelope fa-sm"></i>
                    <input type="text" placeholder="Email" />
                  </div>
                  <div className="contact-form" id="Message">
                    {/* <input type="text" placeholder="Message" /> */}
                    <i class="fa-solid fa-message fa-sm"></i>
                    <textarea name="message" id="" cols="30" rows="6"  placeholder="Message.."></textarea>
                  </div>
                  <button className="contact-btn">send message</button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Login;

